import SelectComparison from './SelectComparison';
import SelectFilter from './SelectFilter';
import NumberInput from './NumbersInput';

const NumericFilter = () => (
  <div>
    <div>
      <SelectFilter />
    </div>
    <div>
      <SelectComparison />
    </div>
    <div>
      <NumberInput />
    </div>
    <div>
      <BtnAddFilter />
    </div>
  </div>
);

export default NumericFilter;
